# Load workbook in read-only, data_only mode to avoid formulas
wb = openpyxl.load_workbook('/workspace/q3_metrics.xlsx', read_only=True, data_only=True)

insights_summary = None
found = False

for sheet_name in wb.sheetnames:
    ws = wb[sheet_name]
    rows = list(ws.iter_rows(values_only=True))
    for i, row in enumerate(rows):
        # iterate through cells with their index
        for j, cell in enumerate(row):
            if isinstance(cell, str) and cell.strip().lower() == 'insights':
                # try to get the cell right below in the same column
                if i + 1 < len(rows):
                    summary_cell = rows[i+1][j]
                    if summary_cell is not None:
                        insights_summary = summary_cell
                        found = True
                        break
        if found:
            break
    if found:
        break

if insights_summary is None:
    print('No Insights summary found.')
else:
    print(insights_summary)

